// /*global chrome*/
import "./App.css";
import react from "react";

function App() {
  return (
    <div id="popup-container" className="Card">
      <div className="Card-header">
        <a className="headline">
          <b>River</b>
        </a>
        <a className="mode">ETA Mode</a>
      </div>
      <div className="Card-layout">
        <div className="data">
          <div>Start</div>
          <input type="text" />
        </div>
      </div>
    </div>
  );
}

export default App;
